const layers = [784, 50, 50, 10];

function guess(inputs) {
    let output = [];
    output[0]=inputs;
    //layer j
    for (let j=1;j<layers.length;j++) {
        //node k in the layer j
        output[j] = [];
        for (let k=0;k<layers[j];k++) {
            output[j][k] = 0;
            //node m in layer j-1
            for (let m=0;m<layers[j-1];m++) {
                output[j][k] += output[j-1][m] * weight[j-1][m][k];
            }
            output[j][k] += bias[j-1][k]
            if (j < layers.length-1) {
                output[j][k] = sigmoid(output[j][k]);
            }
        }
    }

    
    let expoutput = output[layers.length-1].map(thisoutput=>{
        return Math.exp(thisoutput);
    })
    
    let sum = expoutput.reduce((acc,cur)=>{
        return acc+cur;
    })
    output[layers.length-1] = expoutput.map(thisoutput => {
        return thisoutput/sum;
    })

    let final = output[layers.length-1].map((num,ind)=>{
        return [ind,num]
    }).sort((a,b)=>{
        return b[1] - a[1];
    })
    return final;
}

function sigmoid(x){
    return 1 / (1 + Math.exp(-x));
}